import React from 'react'
import './adminDash.css'
import '../'

const AdminHeader = ({agencyname}) => {
  return (
    <header>
        <h2>{agencyname}</h2>
        <button className='btn'>Create a journey</button>
    </header>
  )
}

export default AdminHeader
